    <div class="right-box">
      <div class="logout" :class="{ buttonSelect: selectIndex==index }" @click="clickButton(index)"
           v-for="(item,index) in listData" @mouseover="mouseover(index)" @mouseout="mouseout()">
        <img :src="item.path" :class="{ imgSelect: selectIndex==index }"/>
        <span class="font16">{{item.name}}</span>
      </div>
      <div class="welcome font16" :class="{active: userInfoIsActive}" @click="goUserInfo">
        欢迎，{{name}}
      </div>
    </div>
  </div>
</template>

<script>
  /**
   * 使用方式
   * 1 引入top组件 import iTop from '@/components/common/ITop'
   * 2 声明   components: {iTop},
   * 3 在html中引用  <iTop/>
   * */
  import {logout} from '../../assets/js/api.js'

  export default {
    name: "top",
    data() {
      return {
        selectIndex: -1,
        userInfoIsActive: false,
        name: "",
        listData: [
          {name: "退出", path: require("../../assets/logout.png")},
          // {name: "帮助", path: require("../../assets/question.png")},
//          {name: "消息", path: require("../../assets/et-message.png")},
          // {name: "后台管理", path: require("../../assets/manager.png")}
        ],
      }
    },
    methods: {
      mouseover: function (index) {
        this.selectIndex = index
      },
      mouseout: function () {
        this.selectIndex = -1
      },
      goUserInfo: function () {
        this.$router.push('/userview');
      },
      clickButton: function (index) {
        // if (this.selectIndex == index) {
        //   return
        // }
        switch (index) {
          case 0:
            logout();
            localStorage.setItem("iKnowsUserName", "")
            this.$router.push("/login")
            break
          // case 1:
          //   // this.$router.push("/help")
          //   break
//          case 1:
//            this.$router.push("/messagecenter")
//            break
          // case 3:
          //   // this.$router.push("/backmanager")
          //   break
          case 1:
            this.$router.push({path:'/'})
        }
      }
    },
    mounted() {
      var name = localStorage.getItem("iKnowsUserName")
      if (name) {
        this.name = name
      } else {
        this.name = ".."
      }
      var path = this.$route.path;
      switch (path) {
      //   case "/logout":
      //     this.selectIndex = 0
      //     break
      //   case "/help":
      //     this.selectIndex = 1
      //     break
      //   case "/messagecenter":
      //     this.selectIndex = 2
      //     break
      //   case "/backmanager":
      //     this.selectIndex = 3
      //     break
        case "/userview":
          this.userInfoIsActive = true;
          break;
        case "/useredit":
          this.userInfoIsActive = true;
          break;
       }
    }
  }
</script>

<style scoped>
