  }

  .top .right-box .buttonSelect {
    color: #1DD1EF;
  }

  .top .right-box .imgSelect {
    background: #1DD1EF;
  }

  .top .imgcontainer {
    position: absolute;
    top: 20px;
    left: 80px;
    height: 48px;
    width: 140px;
    cursor: pointer;
  }

  .top .right-box {
    margin-left: 200px;
    float: right;
    display: inline-block;
    position: absolute;
    top: 40px;
    right: 80px;
    height: 28px;
    line-height: 28px;
    vertical-align: middle;
  }

  .top .right-box div {
    cursor: pointer;
    float: right;
    height: 28px;
    line-height: 28px;
    display: inline-block;
    vertical-align: middle;
  }

  .top .right-box img {
    border-radius: 50%;
