    line-height: 28px;
  }

  .top .right-box .welcome {
    cursor: cursor;
    color: #555555;
    font-weight: bolder;
  }
  .top .right-box .welcome:hover{
    color: #1DD1EF;
  }
  .top .right-box .active{
    color: #1DD1EF;
  }
